import React from 'react'

function Header() {
  return (
    <div>
        <div className="d-flex justify-content-center align-items-center" style={{ height: "200px" }}>
            <img src="Logo.png" alt="Image" className="img-fluid" />
        </div>
    </div>
  )
}

export default Header
